script: |
  super -f text -I q10851.spq | sort > q10851.out

inputs:
  - name: q10851.spq
    data: |
      SELECT DISTINCT + col2 / col2 * - + col0 AS col1, - col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q10851.out
    data: |
      -15	-15
      -87	-87
      -97	-97
